import React, { Component } from "react";
import ColumnContainer from "./ColumnContainer";
import Header from "./Header";
import Footer from "./Footer";

class TableApp extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <Header />
        <ColumnContainer />
        <Footer />
      </React.Fragment>
    );
  }
}

export default TableApp;
